def main() -> None:
    # sampling points
    Radius_NFW, Dens_NFW, Mass_NFW, Pote_NFW, dDdPsi_NFW = np.loadtxt( 'Record__ParEquilibriumIC_Model_2_RArray', unpack=True )
    BEng_NFW, InDF_NFW, DisF_NFW                         = np.loadtxt( 'Record__ParEquilibriumIC_Model_2_EArray', unpack=True )

    plot_radial_profiles( Radius_NFW, Dens_NFW, Mass_NFW, Pote_NFW, dDdPsi_NFW, 'NFW' )
    plot_energy_profiles( BEng_NFW, InDF_NFW, DisF_NFW, 'NFW' )

    Radius_Table, Dens_Table, Mass_Table, Pote_Table, dDdPsi_Table = np.loadtxt( 'Record__ParEquilibriumIC_Model_0_RArray', unpack=True )
    BEng_Table, InDF_Table, DisF_Table                             = np.loadtxt( 'Record__ParEquilibriumIC_Model_0_EArray', unpack=True )

    plot_radial_profiles( Radius_Table, Dens_Table, Mass_Table, Pote_Table, dDdPsi_Table, 'Table' )
    plot_energy_profiles( BEng_Table, InDF_Table, DisF_Table, 'Table' )

if __name__ == '__main__':
    main()
